}

.share-tools .popup-menu:before {
    content: "";
    border-left: 14px solid transparent;
    border-right: 14px solid transparent;
    border-bottom: 16px solid rgba(0, 0, 0, .9);
    position: absolute;
    top: -15px;
    left: 15px;
    height: 0;
    width: 0;
    z-index: 99
}

.share-tools .popup-menu {
    background-color: rgba(0, 0, 0, .9);
    display: none;
    padding: 9px 18px;
    position: absolute;
    bottom: -76px;
