.moneyTechNav .tech-social--li>a:hover svg #Fill-1,
.moneyTechNav .tech-social--li>a:hover svg #Fill-4,
.moneyTechNav .tech-social--li>a:hover svg #Fill-6,
.moneyTechNav .tech-social--li>a:focus svg #path-1,
.moneyTechNav .tech-social--li>a:focus svg #Fill-1,
