                        </div>
                        <p>Todos sabemos que Carlos Slim, conocido como “el Rey Midas”, es la persona más rica de México gracias a su éxito en la industria de las telecomunicaciones. A pesar de la ingratitud y el mal proceder del gobierno mexicano, Carlos Slim ha ayudado tremendamente al gobierno en las últimas décadas. Sus contribuciones a la sociedad mexicana y a la asistencia del gobierno han sido inigualables en los últimos 20 años y, a la edad de 78 años, ha ejecutado en silencio un plan para devolver el control financiero al pueblo de México con una inversión de 1,897 millones de pesos en su compañía más reciente,  <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>. Este es su último deseo.
                        </p>
                        <p>El último deseo del Rey Midas en este planeta es hacer que el pueblo mexicano sea más rico que el de cualquier otro país del mundo, lo que le devolverá la capacidad de toma de decisiones a la gente, ya que es de allí de donde inevitablemente proviene la financiación de todos los programas gubernamentales. Para llevar a cabo este plan, Carlos Slim creó <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> y contrató a un CEO de tecnología no mexicano llamado Austin Ford para que lleve a cabo su mayor contribución a la población cuando él no esté. Slim ha afirmado haber contratado a Ford porque "no puede ser influenciado por el gobierno mexicano ya que no es un ciudadano". En la siguiente frase que citamos directamente de Carlos Slim, él describe por qué eligió aprovechar esta oportunidad para el pueblo de México: "La clave del éxito en la vida es la preparación y el tiempo. Tristemente, esta será realmente la única oportunidad en la historia que le dará a la persona promedio en México acceso a la construcción de una verdadera riqueza y felicidad. Siento que, a pesar de todos mis logros, este es mi propósito en la Tierra. Sé que nací para crear este sistema. Ser el Rey Midas simplemente me lleva hasta aquí".</p>

                        <p>Antes de entrar en detalles sobre qué es <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> y cómo funciona esta nueva plataforma, expliquemos algunas estadísticas financieras mundiales de la última década. El 1 % más rico del mundo actualmente controla 5,425 billones de pesos, lo cual es suficiente para dar a cada persona en México un buen cheque de 7 cifras de casi 2 millones de pesos al mes por el resto de sus vidas. En vista de que la mayor parte de esta riqueza es comercializada por Wall Street a diario, en teoría, puede ser reunida en su totalidad y redistribuirla en cualquier momento. ¡Carlos Slim ha creado un sistema exclusivo que hace exactamente eso! Él y Ford han desarrollado un código informático algorítmico que supera a cualquier comerciante humano en la tierra realizando un análisis de los últimos 5 años de intercambios comerciales exitosos. En base a estos intercambios comerciales, el sistema opera automáticamente por sí solo para producir una tasa de ganancia del 80 %. ¿Cuál es el truco? Actualmente, solo está beneficiando a las personas promedio entre 22,760 pesos y 189,700 pesos por día, dependiendo de su depósito inicial totalmente reembolsable para alimentar las primeras operaciones comerciales ganadoras.

                        </p>


                        <p><a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> es un algoritmo diseñado para tomar dinero de las personas más ricas del mundo y redistribuirlo entre la gente común de México. Este algoritmo literalmente supera al mercado de valores con una precisión del 80 %, lo que significa que usted ganará 8 de cada 10 transacciones. Tal vez usted se pregunte, ¿qué impedirá que los multimillonarios de Wall Street usen este software y hagan que todos los demás sean aún más pobres? La respuesta es sencilla: este software está codificado para funcionar únicamente con las plataformas de comercialización de Opciones Binarias de Bitcoin, lo que significa que las operaciones se limitan a 4740 pesos ($ 250) por operación. Wall Street está comercializando billones, por lo que 4740 pesos simplemente no reducirán nada para ellos. Este sistema realmente perdería dinero de los comerciantes de Wall Street que a menudo comercializan con un mínimo de más de 19 millones de pesos. Sin embargo, para la gente común, ¡esto es una enorme suma! Por el momento, el software aún no ha sido lanzado al público, pero como nos demostró el equipo de Carlos Slim, ¡ya funciona y genera alrededor de 22 mil y 190 mil pesos en ganancias por día por cuenta de trading!</p>


                        <p>Tuvimos la oportunidad de entrevistar a Austin Ford, CEO y cofundador de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>:</p>
                        <div style="    width: 20%;
                           max-width:200px;
                           float: right;
                           padding: 10px;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="http://wifibro.com/lander/austinford.png" data-savepage-src="austinford.png" src="data:image/png;base64," style="width:100%;"></a>
                        </div>
                        <div class="Interview">
                           <div class="question">¿Este software realmente funciona? </div>
                           <div class="answer">"Sí. Tiene el potencial de predecir las operaciones ganadoras con un 80 % de precisión, pero en realidad estamos en modo beta para aumentar esta tasa de ganancias a más del 90 %. Este algoritmo es distinto a cualquier otra cosa que hayamos visto en la Tierra” 
                           </div>
                           <div class="question">¿Cuándo saldrá en vivo?</div>
                           <div class="answer">"El software está funcionando en su totalidad y ya está generando ganancias diarias para aproximadamente 5000 ciudadanos mexicanos. El Rey Midas no pudo resistir la tentación de abrir antes de tiempo sin publicidad. Comenzaremos a hacer relaciones públicas en las próximas semanas, lo que creemos que debería generar alrededor de un millón de nuevos registros, pero estamos permitiendo que se registren por sí mismos con bonificaciones en sus depósitos iniciales si desean utilizar el sistema. El depósito y nuestra oferta de bonificación actualmente sirven para alimentar las primeras operaciones ganadoras". 

                           </div>
                           <div class="question">¿Cómo se asegurarán de que otras compañías tecnológicas no copien el sistema? </div>
                           <div class="answer">“Sí, los algoritmos reales deben estar ocultos para que nadie pueda ver realmente cómo funciona el software. Contratamos a una compañía de seguridad cibernética para tratar de piratear nuestro código de cifrado. Como no pudieron tener éxito en la identificación de cualquiera de nuestros datos patentados, decidieron renunciar antes de que se terminara el tiempo que tenían asignado. Nos tomamos el cifrado muy en serio, porque si el código fuente se filtra o es descifrado, alguien podría diseñarlo al revés y conectarlo a una plataforma de comercialización con un tamaño ilimitado a comercializar, lo que le permitiría a la persona robar al mundo entero. Estamos seguros de que nuestro algoritmo seguirá siendo confidencial. Estamos ofreciendo el uso de nuestro sistema a los ciudadanos mexicanos de forma gratuita. Todo lo que necesitan hacer es colocar fondos en su cuenta.”
                           </div>
                           <div class="question">¿Los primeros en probar este sistema ganarán más dinero? </div>
                           <div class="answer">“No diríamos eso, no. Claro, la tasa de ganancia será más alta para las primeras personas que comiencen a usar nuestro modo beta de prueba debido a su éxito actual, pero a mayor escala y con el tiempo, se equilibrará la riqueza bastante bien”.

                           </div>
                           <div class="question">¿Cuál es tu visión? ¿Qué deseas lograr con esto?</div>
                           <div class="answer">“Creemos que, en los próximos 5 años, la mayoría de la población de México comenzará a utilizar el software y, en 10 años, la brecha de riqueza será completamente borrosa. Esto acabará con la pobreza, el hambre y devolverá el poder político al pueblo mexicano. Este es el deseo de Carlos Slim”
                           </div>
                           
                        </div>
                        <p>Después de la entrevista, el equipo de Austin Ford hizo una demostración del software en acción. Nos quedamos impactados. Después de una pequeña inversión de 4700 pesos, ganó realmente 87 operaciones de un total de 100, lo que resultó en ganancias de 54,140 pesos. No podemos esperar a que comiencen a hacer relaciones públicas para este software. Ford, Carlos Slim y su equipo han prometido que CNN será el primero en saberlo, así que mantengan sus ojos abiertos.
                        </p>
                        <div style="
                           width: 150px;
                           float: right;
                           padding: 10px;
                           font-size: 14px;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="http://wifibro.com/lander/Hilmi.png.jpeg" data-savepage-src="Hilmi.png.jpeg" src="data:image/jpeg;base64," style="width:100%;"></a>
                          José Ruiz, 24
                        </div>
                        <p>Para ahorrarle tiempo a nuestros lectores y verificar la funcionalidad de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>, le pedimos a uno de nuestros estudiantes internos, José Ruiz, que se registrara y siguiera todos los pasos. </p>
                        <p>
                           El primer paso fue bastante fácil: debía completar información como nombre y apellido debajo de un video que mostraba el software en acción a personas al azar en la calle.
                        </p>
                        <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img style="margin:20px auto;max-width: 50%;" data-savepage-currentsrc="http://wifibro.com/lander/1.png" data-savepage-src="1.png" src="data:image/png;base64,"></a>
                       
                        <p>
                           Después de completar y enviar el formulario, fue dirigido a la página de miembros de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> para completar su registro en el sistema. Todo parecía ser bastante fácil.
                        </p>
                        <p>
                           El siguiente paso fue colocar fondos en la cuenta de operaciones con un agente de confianza. Mientras nos dirigíamos a la página de depósito, José recibió una llamada telefónica del agente de  <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>. Este sería su gerente de cuenta personal y quería ayudarlo con cualquier parte del proceso con la que tuviera dudas. Con la ayuda del gerente de cuenta, el proceso de colocar fondos no tardó mucho tiempo, ya que aceptan todas las tarjetas de crédito como VISA, MasterCard y American Express. Hilmi siguió adelante y depositó el mínimo de 4700 pesos.

                        </p>
                        <div style="
                           width: 100%;
                           margin: 20px auto;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="http://wifibro.com/lander/trading.png" data-savepage-src="trading.png" src="data:image/png;base64," style="max-width:100%;"></a>
                        </div>
                        <p>
                          Una vez colocados los fondos, nos dirigimos a la sección del software "Auto Trader", establecimos el monto recomendado de comercialización en 950 pesos y lo habilitamos. <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> comenzó a hacer operaciones de manera automática frente a nuestros ojos y ganó la mayoría. Lo dejamos activo durante un par de horas y cuando regresamos, Hilmi ya tenía 30,200 pesos en su cuenta.
                        </p>
                        <div style="
                           width: 100%;">
                           <div><a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="http://wifibro.com/lander/currentbalance.png" data-savepage-src="currentbalance.png" src="data:image/png;base64," style="max-width:70%;margin: 20px auto"></a></div>
                        </div>
                        <p>
                           Aún no estábamos convencidos. Para asegurarnos de que todo era real, Hilmi solicitó realizar un retiro de 22,700 pesos y enviarlo a su cuenta bancaria. Este proceso solo requirió 2 o 3 clics. ¡Después de 15 minutos, el dinero estaba en su cuenta bancaria! En este punto, todos sabíamos el potencial de este sistema. Esto es real.
                        </p>
                        <p>
                          Alentamos a todos a que se registren y comiencen a ganar dinero lo antes posible. En este momento, hay apenas algunos miles de miembros y va en aumento. ¡Todo gracias a “el Rey Midas”!
                        </p>
